1,article/add,article/add,POST,"{""title"":""Tips Lembur Kerja yang Sehat "",""description"":""Bagi pekerja profesional dari beragam profesi, terkadang tuntutan kerjaan yang dikejar tenggat (deadline) mengharuskan waktu bekerja melebihi ambang normal. Sesekali, mungkin tubuh masih menerima kondisi ini. Namun kalau keseringan mulai timbul berbagai efek samping. Lebih mudah lelah, berkurangnya konsentrasi, punggung kaku, maupun muncul nyeri pada pinggang adalah beberapa bentuk peringatan dari tubuh agar kita segera beristirahat.\r\nMengonsumsi stimulan mungkin jadi pilihan. Asal hati-hati, terlampau berlebih malah mendatangkan akibat buruk. Misalnya kopi, dalam takaran normal  bisa mengurangi risiko gangguan jantung, diabetes, dan bahkan kanker menurut beberapa penelitian. Tapi kalau over dosis, akan membuat tubuh mengalami dehidrasi dan insomsia.\r\nPilihan selanjutnya minuman berenergi, apalagi bombardir iklan menjanjikan banyak manfaat. Tapi, masih ingatkah dengan kasus Mita Diran, sang copywriter muda yang meninggal setelah 30 jam bekerja? Ya, ia dikabarkan 'bergantung' pada minuman berenergi saat lembur. ""}",::1,"Mozilla/5.0 (Windows NT 6.1; rv:23.0) Gecko/20100101 Firefox/23.0",,1,,"2014-05-09 20:06:30",admin
